import React from 'react'
import { useState } from "react"

const Header = () => {


  const [tittle, setittle] = useState('uhuy')
  const [umur, setumur] = useState(5)
  const [kamar, setkamar] = useState([
    {
      id: 1, terisi: true, harga:18000000 ,room: 'kamar 1'
    },{
      id: 2, terisi: true, harga:18000000 ,room: 'kamar 2'
    },{
      id: 3, terisi: false, harga:18000000 ,room: 'kamar 3'
    },{
      id: 4, terisi: true, harga:18000000 ,room: 'kamar 4'
    },{
      id: 5, terisi: true, harga:18000000 ,room: 'kamar 5'
    },{
      id: 6, terisi: false, harga:18000000 ,room: 'kamar 6'
    },{
      id: 7, terisi: true, harga:18000000 ,room: 'kamar 7'
    },
  ])



  const ganti = () => {
    setittle('hohoho');
    setumur(8);
  }


  return (
    <div>
      <h1>
        {tittle}
        {umur}
      <button onClick={ ganti  }>
        ganti bro


      </button>

      </h1>


    </div>
  )
}



export default Header
